import React from "react";
import { Card } from "antd";
import moment from "moment";

function MovieDetails(props) {
  return (
    <Card title="Details" className="details">
      {props.show && (
        <div>
          <ul>
            <li>
              <strong>Movie: </strong> {props.show.title}
            </li>
            <li>
              <strong>Country: </strong> {props.show.countries}
            </li>
            <li>
              <strong>Release Date: </strong>
              {moment(
                props.show.release_date.replace(/-/g, "/"),
                "Y/M/D"
              ).format("MMMM D, Y")}
            </li>
            <li>
              <strong>Runtime: </strong> {props.show.runtime} minutes
            </li>
            <li>
              <strong>Genres: </strong> {props.show.genres}
            </li>
          </ul>
        </div>
      )}
    </Card>
  );
}

function Statistics(props) {
  console.log(props.show);
  return (
    <Card title="statistics" className="details">
      <div>
        <ul>
          <li>
            <strong>TMDB Ratings: </strong> {props.show.title}
          </li>
          <li>
            <strong>TMDB Votes: </strong> {props.show.countries}
          </li>
          <li>
            <strong>TMDB Popularity: </strong>
            {moment(props.show.release_date.replace(/-/g, "/"), "Y/M/D").format(
              "MMMM D, Y"
            )}
          </li>
          <li>
            <strong>Runtime: </strong> {props.show.runtime} minutes
          </li>
          <li>
            <strong>Genres: </strong> {props.show.genres}
          </li>
        </ul>
      </div>
    </Card>
  );
}

export { MovieDetails, Statistics };
